   "source": [
    "## 4. Summary of Analysis with Key findings and Visualisations\n",
    "\n",
    "Let us find the following metrics for the last five seasons for the teams that made it to the playoffs.\n",
    "\n",
    "1. Top 5 teams by Average Turnover Ratio\n",
    "2. Top 5 teams by Average Win Percentage\n",
    "3. Top 5 teams by Average Points\n",
    "4. Top 5 teams by Average Field Goals Made\n",
    "5. Top 5 teams by Average Free Throw Rate"
   ]
  },
