   "source": [
    "options(repr.plot.width = 10, repr.plot.height = 10)\n",
    "top_n(team_playoffs_metrics %>% filter(season >= \"2016-17\") %>% group_by(team) %>% \n",
    "  summarize(turnover_ratio = mean(turnover_ratio)), n=5, turnover_ratio) %>%\n",
    "  mutate(team = fct_reorder(team, turnover_ratio)) %>%\n",
    "  ggplot(., aes(x=turnover_ratio, y=team))+\n",
    "              geom_bar(stat='identity',fill=\"steelblue\") +\n",
    "    theme(\n",
    "      panel.grid.minor.y = element_blank(),\n",
    "      panel.grid.major.y = element_blank(),\n",
    "      panel.background = element_rect(fill='light grey', colour='black'),\n",
    "      text = element_text(size = 16),\n",
    "      legend.position=\"none\"\n",
    "    ) +\n",
    "    xlab(\"\") +\n",
    "  labs(title='Top 5 teams by average Turnover Ratio') \n",
    "\n"
   ]
