   "source": [
    "top_5_teams <- top_n(team_playoffs_metrics %>% filter(season >= \"2016-17\") %>%\n",
    "      group_by(team) %>% \n",
    "      summarize(turnover_ratio = mean(turnover_ratio)), n=5, turnover_ratio) %>%\n",
    "      select(team)\n",
    "options(repr.plot.width = 40, repr.plot.height =20)\n",
    "\n",
    "team_playoffs_metrics %>% filter(team %in% top_5_teams$team) %>%  filter(season >= \"2016-17\") %>%\n",
    "  ggplot(., aes(season))+\n",
    "              geom_line(aes(x=season, y = turnover_ratio, group = team, color = team), size=2) +\n",
    "  scale_fill_brewer(palette=\"Accent\") +\n",
    "  geom_point(aes(x=season, y = turnover_ratio, group = team, color = team), size=10) +\n",
    "  theme(text = element_text(size = 40),\n",
    "        panel.grid.minor.y = element_blank(),\n",
    "        panel.grid.major.y = element_blank(),\n",
    "        panel.background = element_rect(fill='light grey', colour='black'),\n",
    "        legend.position=\"bottom\",\n",
    "        legend.key = element_rect(fill='light grey', colour='black'),\n",
    "        legend.key.size = unit(5, 'cm'), #change legend key size\n",
    "        legend.key.height = unit(5, 'cm'), #change legend key height\n",
    "        legend.key.width = unit(5, 'cm'), #change legend key width\n",
    "        legend.title = element_text(size=34), #change legend title font size\n",
    "        legend.text = element_text(size=40)) + #change legend text font size \n",
    "  labs(title='The Turnover Ratio of the teams over the last 5 seasons') \n",
    "\n",
    "\n"
   ]
