    "  mutate(team = fct_reorder(team, field_goals_made)) %>%\n",
    "  ggplot(., aes(x=field_goals_made, y=team))+\n",
    "              geom_bar(stat='identity',fill=\"maroon\") +\n",
    "    theme(\n",
    "      panel.grid.minor.y = element_blank(),\n",
    "      panel.grid.major.y = element_blank(),\n",
    "      panel.background = element_rect(fill='dark grey', colour='black'),\n",
    "      text = element_text(size = 16),\n",
    "      legend.position=\"none\"\n",
    "    ) +\n",
    "    xlab(\"\") +\n",
    "  labs(title='Top 5 teams by average Field Goals Made') "
   ]
