   "source": [
    "options(repr.plot.width = 10, repr.plot.height = 10)\n",
    "top_n(team_playoffs_metrics %>% filter(season >= \"2016-17\") %>% group_by(team) %>% \n",
    "  summarize(free_throw_rate = mean(free_throw_rate)), n=5, free_throw_rate) %>%\n",
    "  mutate(team = fct_reorder(team, free_throw_rate)) %>%\n",
    "  ggplot(., aes(x=free_throw_rate, y=team))+\n",
    "              geom_bar(stat='identity',fill=\"chocolate\") +\n",
    "    theme(\n",
    "      panel.grid.minor.y = element_blank(),\n",
    "      panel.grid.major.y = element_blank(),\n",
    "      panel.background = element_rect(fill='dark grey', colour='black'),\n",
    "      text = element_text(size = 16),\n",
    "      legend.position=\"none\"\n",
    "    ) +\n",
    "    xlab(\"\") +\n",
    "  labs(title='Top 5 teams by average Free Throw Rate') "
   ]
